import React from 'react';
import { auth } from '../services/firebase'
import Button from 'react-bootstrap/Button';
import '../App.css';

const Home = ({ user }) => {
    return (
        <div className="home">
            <h1>Hello, <span></span>{user.displayName}</h1>
            <img src={user.photoURL} alt=""></img>
            <div id=".div-top-menu">
                <Button id=".button-signout" variant="outline-secondary" onClick={() => auth.signOut()}>Sign out</Button>
            </div>     
        </div>
    )
}

export default Home;
